import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'

const songs = [
  {
    id: 1,
    link: 'https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r',
    ranking: 1
  },
  {
    id: 2,
    link: 'https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r',
    ranking: 1
  },
  {
    id: 3,
    link: 'https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r',
    ranking: 1
  }
]

const Button = ({handleClick, text}) => {
  return (
    <button onClick = {handleClick}>
      {text}
    </button>
  )
}

const Song = ({link}) => {
  return (
    <>
      <iframe title = "pog" src={link} width="300" height="80" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
      <br/>
    </>
  )
}

const App = () => {
  const [newSong, setNewSong] = useState('') 
  const pog1 = () => {console.log("pog1")}
  const pog2 = () => {console.log("pog2")}
  const addSong = (event) => {
    event.preventDefault()
    const songObject = {
      id: songs.length + 1,
      link: newSong,
      ranking: 1
    }
    songs.concat(songObject)
    setNewSong('')
  }
  const handleSongChange = (event) => {
    setNewSong(event.target.value)
  }

  return (
    <div>
      <h1>
        pog
      </h1>
      <div class="container">
        <div class="fixed">
          <h2>
            Song 1
          </h2>
          <Song link={songs[0].link}/>
          <Button handleClick={pog1} text='pog1'/>
        </div>
        <div class="grow">
          <h2>
            Song 2
          </h2>
          <Song link={songs[1].link}/>
          <Button handleClick={pog2} text='pog2'/>
        </div>
      </div>
      <form onSubmit={addSong}>
        <input 
          value={newSong}
          onChange={handleSongChange}
        />
        <button type="submit">Add</button>
      </form>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
